import React from "react";
import Card from "./Card";
import contacts from "./contacts";
import "../styles.css";




function App() {
    contacts.forEach(function(contact){
        return <Card name={contact.name} imgURL={contact.imgURL} ph={contact.phone} mail={contact.email}  />

    })
}

export default App;
